func TestHandleXrayResult(t *testing.T) {
	xrayResultJsonDemo, err := base64.StdEncoding.DecodeString(xrayJsonResultsBase64)
	if err != nil {
		t.FailNow()
	}

	vuls := HandleXrayResult(xrayResultJsonDemo)
	test := assert.New(t)
	test.Greater(len(vuls), 0, spew.Sdump(vuls))
	spew.Dump(vuls)
}

